import React from 'react';

import classes from './Toolbar.css'
import Logo from '../../Logo/Logo'
import navigationItems from '../NavigationItems/NavigationItems';

const toolbar = (props) => (

    <header className={classes.Toolbar}>
        <div>MENU</div>
        <Logo />
        <nav>
            <NavigationItems />
        </nav>
    </header>

);

export default toolbar;
